import axios from "axios";

export function storeExpense(expenseData) {
  axios.post(
    "https://react-native-http-de5e5-default-rtdb.asia-southeast1.firebasedatabase.app/expenses.json",
    expenseData
  );
}

export function fetchExpenses() {
  axios.get(
    "https://react-native-http-de5e5-default-rtdb.asia-southeast1.firebasedatabase.app/expenses.json"
  );
}
